import React from "react";

const Primary = ({ value, center, onClick }) => {
  return (
    <div
      className={`h-fit w-fit bg-purpleAreatomic-500 py-1 px-8 rounded-lg text-sm font-semi-bold select-none cursor-pointer shadow-second ${
        center && "mx-auto"
      }`}
      onClick={() => onClick()}
    >
      <Text.label cursor={true} color={"text-blueAreatomic-500"}>
        {value}
      </Text.label>
    </div>
  );
};

export { Primary };
